import React from 'react'
import { useState } from 'react'
import { useNavigate } from 'react-router-dom'



const Home = () => {
    let user = JSON.parse(localStorage.getItem('user-info'))
    const hanleLogout = () => {
        localStorage.clear
    }
    return (
        <div>
            <h1>Home</h1>
            <button onClick={hanleLogout}>SignOut</button>
        </div>

    )
}

export default Home
